import { Container, Logo, Typography } from "@toptal/picasso";

import * as S from "./styles";

const Nav = () => {
  return (
    <Container
      flex
      padded={0.75}
      justifyContent="center"
      style={S.navContainer}
    >
      <Container flex gap={0.75} alignItems="center" style={S.navSubContainer}>
        <Logo variant="white" />
        <Typography color="inherit" style={S.navTypo}>
          Top heroes
        </Typography>
      </Container>
    </Container>
  );
};

export default Nav;
